								 <p>Shërbimi në re Boost mund të pikasë automatikisht kur sajti juaj ka nevojë t’i riprodhohet CSS-ja Kritike dhe e kryen këtë funksion në prapaskenë, pa u dashur që të mbikëqyrni ju dorazi.</p>','Automatically updated'=>'Përditësuar automatikisht','Manual Critical CSS regeneration'=>'Riprodhim dorazi CSS-je Kritike','Must be done manually'=>'Duhet të bërë dorazi','Move important styling information to the start of the page, which helps pages display your content sooner, so your users don’t have to wait for the entire page to load. Commonly referred to as Critical CSS.'=>'Kaloni hollësi të rëndësishme stilizimi në fillim të faqes, çka ndihmon që faqet ta shfaqin lëndën tuaj më shpejt, që përdoruesve të mos ju duhet të presin për ngarkimin e krejt faqes. Zakonisht e quajtur CSS Kritike.','Optimize CSS Loading'=>'Optimizoni Ngarkim CSS-je','Generate text, tables, and lists'=>'Prodhoni tekst, tabela dhe lista','<p>To enhance the speed of your site, with this plan you will need to optimize CSS by using the Manual Critical CSS generation feature whenever you:</p>
