			Please contact your site admin if you think this is a mistake.'=>'S’keni lejet e sakta për të kryer këtë veprim.
			Ju lutemi, lidhuni me përgjegjësin e sajtit tuaj, nëse mendoni se bëhet fjalë për gabim.','The request is not signed correctly.'=>'Kërkesa s’është nënshkruar si duhet.','This request method does not support body parameters.'=>'Kjo metodë kërkese nuk mbulon parametra lënde.','This request method is not supported.'=>'Metoda e kërkesës është e pambuluar.','The request method is missing.'=>'Mungon metoda e kërkesës.','You cannot call this method until Jetpack Config is configured'=>'S’mund të thërrisni këtë metodë pa u formësuar Jetpack Config-u','Error Details: %s'=>'Hollësi Gabimi: %s','The Client ID/WP.com Blog ID of this site'=>'ID-ja si Klient/ID-ja e Blogut WP.com për këtë sajt','Jetpack Plugin Version'=>'Version Shtojce Jetpack','The number of sites of the connected WP.com user'=>'Numër sajtesh për përdoruesin e lidhur WP.com','The WP.com user email of the connected user'=>'Email përdoruesi WP.com për përdoruesin e lidhur','The WP.com username of the connected user'=>'Emër përdoruesi te WP.com për përdoruesin e lidhur','The WP.com user ID of the connected user'=>'ID-ja WP.com e përdoruesit për përdoruesin e lidhur','Domain `%1$s` just failed is_usable_domain check as it is a subdomain of WordPress.com.'=>'Përkatësia `%1$s` s’e kaloi dot kontrollin is_usable_domain, ngaqë është nënpërkatësi e WordPress.com-i.','Domain `%1$s` just failed is_usable_domain check as it uses an invalid top level domain.'=>'Përkatësia `%1$s` s’e kaloi dot kontrollin is_usable_domain, ngaqë përdor një përkatësi shkalle të epërme të pavlefshme.','Domain `%1$s` just failed is_usable_domain check as it is in the forbidden array.'=>'Përkatësia `%1$s` s’e kaloi dot kontrollin is_usable_domain, ngaqë gjendet në një varg të ndaluar.','Domain `%1$s` just failed is_usable_domain check as it is empty.'=>'Përkatësia `%1$s` s’e kaloi dot kontrollin is_usable_domain, ngaqë është e zbrazët.','Invalid Registration State'=>'Gjendje e Pavlefshme Regjistrimi','Error Details: Jetpack ID begins with a numeral. Do not publicly post this error message! %s'=>'Hollësi Gabimi: ID-ja e Jetpack-ut fillon me një numër. Mos e postoni publikisht këtë mesazh gabim! %s','Error Details: Jetpack ID is not a scalar. Do not publicly post this error message! %s'=>'Hollësi Gabimi: ID-ja e Jetpack-ut s’është numër. Mos e postoni publikisht këtë mesazh gabimi! %s','Error Details: Jetpack ID is empty. Do not publicly post this error message! %s'=>'Hollësi Gabimi: ID-ja e Jetpack-ut është e zbrazët. Mos e postoni publikisht këtë mesazh gabim! %s','PHP\'s XML extension is not available. Jetpack requires the XML extension to communicate with WordPress.com. Please contact your hosting provider to enable PHP\'s XML extension.'=>'Zgjerimi XML i PHP-së s’gjendet. Jetpack-u lyp zgjerimin XML që të komunikojë me WordPress.com. Ju lutemi, lidhuni me furnizuesin tuaj të strehimit të sajtit që të aktivizojë zgjerimin XML të PHP-së.','Jetpack experienced an issue trying to save options (cannot_save_secrets). We suggest that you contact your hosting provider, and ask them for help checking that the options table is writable on your site.'=>'Jetpack-u hasi një problem teksa provohej të ruheshin mundësitë (cannot_save_secrets). Sugjerojmë të lidheni me shërbimin tuaj të strehimit të sajtit dhe t’u kërkoni t’ju ndihmojnë të kontrolloni nëse tabela e mundësive është e shkrueshme në sajtin tuaj.','Could not confirm new owner.'=>'S’u ripohua dot pronari i ri.','New owner is not connected'=>'I zoti i ri s’është i lidhur','New owner is same as existing owner'=>'I zoti i ri është i njëjtë me të zotin ekzistues','New owner is not admin'=>'I zoti i ri s’është një përgjegjës','Last heartbeat sent at: %s'=>'Rrahja e fundit e zemrës dërguar më: %s','%s is not a valid command.'=>'%s s’është urdhër i vlefshëm.','Your connection with WordPress.com seems to be broken. If you\'re experiencing issues, please try reconnecting.'=>'Lidhja juaj me WordPress.com duket të jetë e dëmtuar. Nëse keni probleme, ju lutemi, provoni të rilidheni.','The required "local_user" parameter is missing.'=>'Mungon parametri i domosdoshëm “local_user”.','Failed to fetch user token from WordPress.com.'=>'S’u arrit të sillej token përdoruesi që nga WordPress.com.','Valid user is required.'=>'Lypset përdorues i vlefshëm.','Jetpack is already connected.'=>'Jetpack-u është i lidhur tashmë.','Blog is already registered'=>'Blogu është tashmë i regjistruar','There was an unspecified error registering the site'=>'Pati një gabim të panjohur në regjistrimin e sajtit','There was an issue validating this request.'=>'Pati një problem me vleftësimin e kësaj kërkese.','The required "nonce" parameter is missing.'=>'Mungon parametri i domosdoshëm “nonce”.','Valid user is required'=>'Lypset përdorues i vlefshëm','User not found.'=>'S’u gjet përdorues.','Invalid user identifier.'=>'Identifikues i pavlefshëm përdoruesi.','Unable to load class %1$s. Please add the package that contains it using composer and make sure you are requiring the Jetpack autoloader'=>'S’arrihet të ngarkohet klasa %1$s. Ju lutemi, shtoni paketën që e përmban, duke përdorur hartuesin dhe sigurohuni se po kërkoni vetëngarkuesin e Jetpack-ut','Script "%s" depends on wp-i18n but does not specify "textdomain"'=>'Programthi “%s” varet nga wp-i18n, por nuk specifikon “textdomain”','Dashboard'=>'Pult','https://wordpress.org/plugins/jetpack-protect'=>'https://wordpress.org/plugins/jetpack-protect','Jetpack Protect'=>'Mbrojtje Jetpack','Security Product FeatureAutomated real-time malware scan'=>'Kontroll i automatizuar, i atypëratyshëm për <em>malware</em>','The isActive argument should be set to false.'=>'Argumenti isActive duhet vënë si <em>false</em>.','Set to false will trigger the site to disconnect.'=>'Vënë si <em>false</em>, do të shkaktojë shkëputjen e sajtit.','A non-empty nonce must be supplied.'=>'Duhet dhënë një <em>nonce</em> jo i zbrazët.','Textdomain aliases should be registered before the %1$s hook. This notice was triggered by the %2$s domain.'=>'Aliaset <em>textdomain</em> duhen regjistruar para grremçit %1$s. Ky shënim u prodhua nga përkatësia %2$s.','Your installation of Jetpack Protect is incomplete. If you installed Jetpack Protect from GitHub, please refer to <a href="%1$s" target="_blank" rel="noopener noreferrer">this document</a> to set up your development environment. Jetpack Protect must have Composer dependencies installed and built via the build command.'=>'Instalimi juaj i Jetpack Protect-it s’është i plotë. Nëse e instaluat Jetpack Protect-in prej GitHub-it, ju lutemi, referojuni <a href="%1$s" target="_blank" rel="noopener noreferrer">këtij dokumenti</a>, që të ujdisni mjedisin tuaj të zhvillimit. Jetpack Protect duhet të ketë varësitë për Composer të instaluara dhe të montuara përmes urdhrit <em>build</em>.','Error loading autoloader file for Jetpack Protect plugin'=>'Gabim në ngarkim kartele vetëngarkuesi për shtojcën Jetpack Protect','Security tools that keep your site safe and sound, from posts to plugins.'=>'Mjete sigurie që e mbajnë sajtin tuaj të parrezik dhe si duhet, nga postimet e deri te shtojcat.','Jetpack Protect did not find any known threats in your site. Threats can be exploited by hackers and cause harm to your website.'=>'Jetpack Protect s’gjeti në sajtin tuaj ndonjë kërcënim të ditur. Kërcënimet mund të shfrytëzohen nga hacker-a dhe të shkaktojnë dëm në sajtin tuaj.']];